// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/utils/cryptography/ECDSAUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/cryptography/draft-EIP712Upgradeable.sol";

contract MetaTxForwarder is EIP712Upgradeable {
    using ECDSAUpgradeable for bytes32;

    struct ForwardRequest {
        address from;
        address to;
        uint256 value;
        uint256 gas;
        uint256 nonce;
        bytes data;
    }

    bytes32 private constant _TYPEHASH =
        keccak256(
            "ForwardRequest(address from,address to,uint256 value,uint256 gas,uint256 nonce,bytes data)"
        );
    mapping(address => uint256) private _nonces;

    function initialize() public initializer {
        __EIP712_init("MetaTxForwarder", contractVersion());
    }

    function getNonce(address from_) public view returns (uint256) {
        return _nonces[from_];
    }

    function verify(ForwardRequest calldata req_, bytes calldata signature_)
        public
        view
        returns (bool)
    {
        address signer = _hashTypedDataV4(
            keccak256(
                abi.encode(
                    _TYPEHASH,
                    req_.from,
                    req_.to,
                    req_.value,
                    req_.gas,
                    req_.nonce,
                    keccak256(req_.data)
                )
            )
        ).recover(signature_);
        return _nonces[req_.from] == req_.nonce && signer == req_.from;
    }

    function execute(ForwardRequest calldata req_, bytes calldata signature_)
        public
        payable
        returns (bool, bytes memory)
    {
        require(
            verify(req_, signature_),
            "MinimalForwarder: signature does not match request"
        );
        _nonces[req_.from] = req_.nonce + 1;

        (bool success, bytes memory returndata) = req_.to.call{
            gas: req_.gas,
            value: req_.value
        }(abi.encodePacked(req_.data, req_.from));

        // Validate that the relayer has sent enough gas for the call.
        // See https://ronan.eth.limo/blog/ethereum-gas-dangers/
        if (gasleft() <= req_.gas / 63) {
            // We explicitly trigger invalid opcode to consume all gas and bubble-up the effects, since
            // neither revert or assert consume all gas since Solidity 0.8.0
            // https://docs.soliditylang.org/en/v0.8.0/control-structures.html#panic-via-assert-and-error-via-require
            /// @solidity memory-safe-assembly
            assembly {
                invalid()
            }
        }

        return (success, returndata);
    }

    /**
     * @dev Get contract version
     * @return (string memory) Version string
     */
    function contractVersion() public pure returns (string memory) {
        return "1.0.0";
    }
}
